import styled from '@emotion/styled';
import { Container, Paper, Stack, Typography } from '@mui/material';
import React from 'react';
import WalletPrev from '../Assests/walletprev.webp';
import TextField from '@mui/material/TextField';

const LoginWrap = styled(Paper)(({ theme }) => ({
    borderRadius: 15,
    width: '100%',
    maxWidth: 700,
    display: 'flex',
    alignItems: 'center',
    padding: 20,
    justifyContent: 'center',
    flexDirection: 'column',
    flexWrap: 'nowrap'
}))
export default function Login() {
    return (
        <Container sx={{
            height: '70vh',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center'
        }} fixed>
            <LoginWrap elevation={24}>
                <img src={WalletPrev} alt='Wallet' width='80%' />
                <Stack sx={{ width: '100%', maxWidth: '564px' }} mt={3}>
                    <Typography fontWeight={600}>Username</Typography>
                    <TextField
                        id="outlined-multiline-flexible"
                        label="Username"
                        multiline
                        maxRows={4}
                        sx={{
                            marginTop: 1,
                            marginBottom: 2
                        }}
                    />
                    <Typography fontWeight={600}>Password</Typography>
                    <TextField
                        id="outlined-multiline-flexible"
                        label="Username"
                        multiline
                        maxRows={4}
                        sx={{
                            marginTop: 1,
                            marginBottom: 2
                        }}
                    />
                </Stack>
            </LoginWrap>
        </Container>
    )
}
